/deep/.el-table__body-wrapper::-webkit-scrollbar {
  height: 10px !important;
}
::-webkit-scrollbar {
  width: 10px; /*对垂直流动条有效*/
  height: 10px; /*对水平流动条有效*/
}

/*定义滚动条的轨道颜色、内阴影及圆角*/
::-webkit-scrollbar-track {
  -webkit-box-shadow: inset 0 0 6px rgba(0, 0, 0, 0.05);
  background-color: inset 0 0 6px rgba(0, 0, 0, 0.05);
  border-radius: 3px;
}

/*定义滑块颜色、内阴影及圆角*/
::-webkit-scrollbar-thumb {
  border-radius: 7px;
  -webkit-box-shadow: inset 0 0 6px rgba(0, 0, 0, 0.05);
  background-color: #e8e8e8;
}
.el-select__caret.el-input__icon {
  .el-icon-arrow-up:before {
    content: "";
  }
}

i.el-select__caret {
  appearance: none;
  -moz-appearance: none;
  -webkit-animation: none;
  .el-icon-arrow-up:before {
    content: "";
  }
}
.el-tabs__nav .el-tabs__item:nth-child(1) span {
  display: none;
}
.sqlAnalysis {
  display: flex;
  height: calc(100vh - 135px);
  background: #fff;
  margin: 0 16px 16px 16px;
  padding: 16px;
  border-radius: 8px;
  overflow: hidden;
  position: relative;
  .left {
    .tree {
      // width: 300px;
      height: 100%;
      max-height: 620px;
      overflow: auto;
      .el-tree {
        margin-top: 8px;
        padding-top: 8px;
        height: calc(100% - 38px);
      }
    }
  }
  .right {
    // flex: 1;
    height: calc(100% - 40px);
    margin-left: 20px;
    // overflow: auto;
    .textarea {
      display: flex;
      height: 150px;
      width: 100%;

      .btns {
        width: 100px;
        margin-right: 8px;
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        .el-button {
          margin: 0;
        }
        .el-button--primary {
          background-color: #409eff;
        }
      }
    }
    .log {
      height: calc(100% - 290px);
      overflow: auto;
    }
    .log >>> .el-textarea.is-disabled .el-textarea__inner {
      /* background-color:white;
        　　border-color: white;*/
      color: #ff0044;
    }
    .tableList {
      height: calc(100% - 290px);
    }
    .el-table {
      // width: 100%;
      // margin-top: 24px;
      overflow-x: scroll;
      .cell {
        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
      }
    }
    // 分页
    .pagination {
      position: absolute;
      bottom: 10px;
      right: 20px;
      // height: 64px;
      display: flex;
      align-items: center;
      flex-direction: row-reverse;
      .el-pagination {
        margin: 0;
      }
    }
  }
  .connection {
    // width: 420px;
    max-height: 620px;
    // height: 100%;
    height: calc(100% - 40px);
    overflow: auto;
    margin-left: 20px;
    margin-right: 8px;
    .queryCriteria {
      display: flex;
      justify-content: space-between;
      margin-bottom: 3px;
      align-items: center;
    }
    .el-card {
      height: 200px;
      margin-top: 10px;
      margin-right: 5px;
      overflow-y: auto;
    }
  }
}
